plane...but nothing prepares you for that 1st invitation after a loss. It doesn't matter if it's a night out to drinks, a birthday party, a shower...your mind divides itself in 2: the "I wanna go back to normal" train of thought & the "I should be ___" mindset.

First, the let's-go-back-to-normal: you want to go back but. Nothing. Feels. Normal. Nothing. But you want it to. You want it to soooo badly, because then it means you don't need to think about this loss anymore. You don't need to feel all the pain or process how traumatic it is, how much it hurts & how much you don't want to talk about it & scream about it all at once.

Then there's the I-should-be. The land of "I should still be X weeks" or "I shouldn't be drinking/eating/doing ___ because I'm supposed to still be pregnant". But you're not. And it's trash. And then you feel like trash & it sucks. You decide to grin and bear it or to shut down and cry which both also suck & then you feel guilty for being such a downer.

But you know what? It does suck & *it's okay* that it sucks. YOU don't suck. You're grieving. There's a difference. So go ahead: say no if you want. Stay in. Sleep. Cry. Your people get it. They may not know what to say, but they're still there. They love you. They understand. The invite is a standing one so it's okay to say no. Just come whenever you're ready.
